Описание отеля Xperia Grand Bali 4* (ex.Grand Bali)
Отель Xperia Grand Bali 4* расположен в центре г. Алания, в 150 м от пляжа Клеопатры. Отель состоит из одного 5-ти этажного корпуса. Grand Bali был открыт в 1996 году. В 2010 году отель полностью реконструирован и поменял название - Xperia Grand Bali. Уютная атмосфера отеля, комфортабельные номера оснащенные современным оборудованием обеспечивают незабываемый отдых.

Месторасположение: 
Отель Xperia Grand Bali  расположен в центре г. Алания, в 120 км от аэропорта Анталии. 

Количество номеров: 
96 номеров: 77 стандартных номеров, 12 больших стандартных номеров (макс.4 человека) 4 двухкомнатных семейных номера (4 взрослых+1 ребенок, макс. 5 человек) и 2 королевских люкса, 1 номер для инвалидов

Описание номеров: 
- кондиционер воздуха;
- личная ванная комната и туалет;
- фен;
- телефон;
- плазменный телевизор; 
- радио 
- индивидуальный сейф 
- балкон ( не во всех номерах);
- 24-часовое обслуживание номеров.

Инфраструктура отеля: 
- парковка;
- камера хранения;
- прачечная, химчистка;
- конференц-зал;

Типы питания: 
Все включено.

Бесплатный сервис: 
- открытый плавательный бассейн 
- закрытый плавательный бассейн ( в зимнее время) 
- детский бассейн 
- напитки по системе "Все включено" с 10.00-23.00 
- питание по системе Все включено" завтрак с 7-10, обед с 12.30-13.30, 17.00 выпечка, ужин с 19.00-21.00 
- лежаки, зонты, матрасы, подушки для отдыха у бассейна 
- комната для просмотра ТВ 
- информационная комната 
- wi-fi 

Платный сервис: 
- услуги доктора;
- парикмахер;
- стирка, химчистка;
- конференц-зал;
- еда и напитки на пляже;
- напитки импортного производства
- свежевыжатые соки 
- мороженое 
- пополнение мини-бара 
- телефон (междугородний, международный) 
- финская сауна 
- турецкая баня 
- массаж, пилинг, косметический кабинет 
- водные виды спорта на пляже 
- лежаки, матрасы, зонты на пляже 
- интернет 

Развлечения и спорт: 
- пляжный волейбол
- около отеля площадки для баскетбола (за дополнительную плату);
- около отеля открыт теннисный корт (за дополнительную плату);
- шахматы;
- карты;
- водные виды спорта на пляже (за дополнительную плату)

Для детей: 
- услуги ухода за детьми;
- детский бассейн;

Рестораны, бары: 
- Street Life Restaurant - A La Carte restaurant - популярное место для встреч гостей отеля. Повара приготовят для вас блюда Турецкой и Интернациональной кухонь. В этом месте вы сможете встретится с друзьями в приятной и спокойной атмосфере. Бар ресторана предлагает множество напитков на любой вкус, а также разнообразые коктейли и свежевыжатый сок. Ресторан открыт для вас с 10.00-00.02. 
- Terrace Restaurant - рассчитан на 120 посадочных мест. В этом ресторане проходят завтрак, обед и ужин гостей отеля. Внутри ресторана есть бар. Terrace Restaurant открыт для вас с 10.00-23.00. 
- TV-room - комната с большим плазменным телевизором и баром. Здесь вы можете посмотреть интернациональные телевизионные каналы, выпить разнообразные напитки предлагаемые в баре. Бесплатный wi-fi интернет. TV-room открыта для вас с 10.00-23.00 

Пляж: 
Собственный песчаный пляж в 150 м от отеля; шезлонги, зонтики, матрасы, полотенца – платно. Бар на пляже платный.
